INSERT INTO `faqs` (`id`, `title`, `content`, `created_by`, `created_at`, `updated_at`) VALUES
(7, 'What are Tips Mandi Currency Plan and benefits?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">This is designed for Intraday, short-term traders in the currency market. There will be 30-40 tips in a month.&nbsp;</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Prices for the monthly plan- 499 (offer price)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Prices for the quarterly plan- 1349 (offer price)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Prices for Half Yearly plan- 2399 (offer price)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Prices for the annual plan- 3599 (offer price)</span></span></span></p>', '1', '2021-07-29 17:10:32', '2021-08-01 17:06:53'),
(8, 'What are Tips Mandi Commodity Plan and benefits?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Tips Mandi Commodity plan is designed for Intraday, short-term traders in commodity markets. There will be 40-50 tips in a month. Tips will be in bullion, energy, base metal.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The monthly plan prices- 499 (offer price)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The quarterly plan prices- 1349 (offer price)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The yearly plan prices- 2399 (offer price)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The yearly plan prices- 3599 (offer price)</span></span></span></p>', '1', '2021-07-29 17:11:35', '2021-08-01 17:07:20'),
(9, 'What are Tips Mandi F&O Plan and benefits?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The F&amp;O plan of Tips Mandi is designed for Intraday trading, short-term traders in the future, and Options. There will be 50-70 Tips in a month.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The monthly plan prices- 499( offer price)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The quarterly plan prices- 1349 ( offer price)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The half-yearly plan- 2399 (offer price)</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The yearly plan price- 3599 ( offer price);</span></span></span></p>', '1', '2021-07-29 17:12:22', '2021-08-07 13:03:58'),
(10, 'What are Tips Mandi Cash Market plans and benefits?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The cash market plan is designed for intraday, short-term traders in the Equity Cash market. There will be 50-60 Tips in a month. The pricing for a month will be 499 (offer price),</span></span></span><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Prices for the quarterly plan - 1349 (offer price), Prices for half-yearly - 2399 (offer price), Prices for annual package - 3599 (offer price).</span></span></span></p>', '1', '2021-07-29 17:13:29', '2021-08-07 13:03:07'),
(11, 'Social Media handles You can follow?', '<p>https://www.facebook.com/TIPS-MANDI-103007425331568/</p>\r\n\r\n<p>https://www.instagram.com/tips_mandi/</p>\r\n\r\n<p>https://www.youtube.com/channel/UCgljhdEwzYdAI99FLRpQI8w/</p>\r\n\r\n<p>https://www.linkedin.com/in/tips-mandi-081542218/</p>', '1', '2021-07-29 17:16:01', '2021-07-29 17:16:01'),
(12, 'Offers to avail while Paying for the plans?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Currently, every plan has a flat 50% off. The offer is available for a limited time</span></span></span></p>', '1', '2021-07-29 17:18:28', '2021-07-29 17:18:28'),
(13, 'How to change the desired language while making a payment?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">TipsMandi provides a multilingual option. If you want to change the language while making payments you can click on the Rupees Icon and then there you can select the desired plan and proceed to pay then you can see the option for language. From there you can change the language you desire. </span></span></span></p>', '1', '2021-07-29 17:19:10', '2021-07-29 17:19:10'),
(14, 'How to Raise a Support Ticket?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">If you have any issues or queries regarding application or services you can go to the setting, from there you can see an option of the support ticket.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Click on the option to enter your name, Email, Phone Number and write down the message in the dialogue box.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The query will be solved by the support team via Email or Call.</span></span></span></p>', '1', '2021-07-29 17:19:53', '2021-08-07 13:05:05'),
(15, 'How to contact us?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">If there is any issue regarding the services</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Go to settings&lt; You will find the Contact Us option&lt; It will take you to WhatsApp.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Raise the ticket and explain the problem or query which will be solved by the designated person.</span></span></span></p>', '1', '2021-07-29 17:22:36', '2021-08-07 12:56:01'),
(16, 'How can You Pay for the plans?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">There are multiple payment options. You can Pay via UPI or select net banking. The payment gateway supports Paytm, Google Pay, Phone Pay UPI.</span></span></span></p>', '1', '2021-07-29 17:26:48', '2021-07-29 17:26:48'),
(17, 'How can you search for the company Listed on BSE/NSE?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Open the application&lt; You will find a search option&lt; click on it and enter the company name you want to search about&lt; click on the name suggested and it is done.</span></span></span></p>', '1', '2021-07-29 17:28:08', '2021-08-07 12:57:10'),
(18, 'Services Provided by the company?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The services offered by the company are Cash Market, Intraday Delivery, Commodity, Currency, IPO, NCD, FD, and Mutual Funds. </span></span></span></p>', '1', '2021-07-29 17:28:56', '2021-08-01 17:11:34'),
(19, 'What are the Plans Provided?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">There are currently 4 different plans you can avail of. Each plan comes with its period and benefits you can select on your comfort level.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">The Four plans available are;</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">1. Tips Mandi Cash Market Plan</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">2. Tips Mandi Currency Plan</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">3. Tips Mandi Commodity Plan;</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">4. Tips Mandi F&O Plan;</span></span></span></p>', '1', '2021-07-29 17:29:35', '2021-08-07 12:58:50'),
(20, 'How to Recover the Password?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Forgot your login credentials, you can recover the password easily.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 1- Open Application and click on the Forgot Password option</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 2- Enter the email provided;</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 3- You will receive a mail to recover the password</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 4- Enter a new password and log in with the same.</span></span></span></p>', '1', '2021-07-29 17:30:08', '2021-08-07 12:59:39'),
(21, 'How to log in via Social Media Accounts?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Google login-&nbsp; You can directly log in via your Gmail account.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 1- Click on the Google icon on the application</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 2- You will get a dialogue box showing all the existing Gmail Id</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 3- Choose the desired Id and you will be directly taken to the dashboard.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\"></span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Facebook Login- You can log in via a Facebook account</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step1- Click on the Facebook icon&nbsp;</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 2- You will be redirected to another page and fill out your Id and password.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 3- If the id is already logged in to the device it will ask for the continuation process</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 4- Account will log in and you will see the dashboard.</span></span></span></p>', '1', '2021-07-29 17:30:59', '2021-08-07 13:00:57'),
(22, 'How to create an account using a mobile number?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">For creating an account in the Tips Mandi application you need to follow these steps</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 1- Open the Tips Mandi application</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 2- Click on create an account</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 3- Enter your phone number and OTP will be received</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 4- Fill the OTP and another page of personal information will appears</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 5-&nbsp; Fill in your name, your email Id, enter the password twice.</span></span></span></p>\r\n\r\n<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">Step 6. The account will be created, you need to log in again and the dashboard will appear</span></span></span></p>', '1', '2021-07-29 17:32:02', '2021-08-07 13:01:42'),
(23, 'How many ways to sign up for Tips Mandi?', '<p><span style=\"font-size:11pt\"><span style=\"font-family:Arial\"><span style=\"color:#000000\">You can sign up via Email, Phone number, and your Facebook Id.</span></span></span></p>', '1', '2021-07-29 17:32:38', '2021-08-01 17:03:57');
